import React from 'react'

const Login = () => {

  const onSubmit = () => {

        console.log('log in application');
        
  }


  const onRegister = () => {

    console.log('on Register application');
    
}


  return (
    <div className="container">
        
        <div className='row'>    
            <div class="col l3 m3 s12"></div>
            <div class="col l6 m6 s12">
                <div class="card-panel z-depth-5">
                    <h5 className="center">Log In</h5>
                    <div className="input-field col s12">                
                      <input id="UserEmail" type="email" class="validate" />
                      <label for="UserEmail">Enter email</label>
                     </div>
            <div className="input-field col s12">
            <input id="UserPassword" type="password" class="validate" />
            <label for="UserPassword">Enter password</label>
            </div>                       	  
            <div className="input-field col s12">
                    <a href="#!" 
                    onClick={onSubmit}
                    className='waves-effect waves-light btn'>Log In</a>  			
            </div>
            <div className="input-field col s12">
            <a href="#!" 
                    onClick={onRegister}
                    className='waves-effect waves-light'>Register</a>  
            </div> 
                </div>
            </div>
            <div class="col l3 m3 s12"></div>

            {/* 
                    */}
        </div>
    </div>
  )
}

export default Login
